import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../css/TimelineGraph.css';

const TimelineGraph = () => {
  const [data, setData] = useState([]);
  const [click, setClick] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3000/data');
        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    fetchData();
  }, []);

  const buttonHandler = (e) => {
    setClick(e.target.value);
  };

  return (
    <div className="timeline-container">
      <div className="button-container">
        <h5>Filter data</h5>
        <ul className="button-list" onClick={buttonHandler}>
          <li>
            <button value='1/2 Hr' className={`btn ${click === '1/2 Hr' ? 'active' : ''}`}>1/2 Hr</button>
          </li>
          <li>
            <button value='1 Hr' className={`btn ${click === '1 Hr' ? 'active' : ''}`}>1 Hr</button>
          </li>
        </ul>
      </div>
      <div className="graph-container">
        <div className="graph">
          <div className="graph-title">Cycle Status</div>
          {data.map((entry, index) => (
            <div
              key={index}
              className="graph-bar"
              style={{ backgroundColor: entry.vibration > 500 ? 'yellow' : 'green' }}
            >
              {((click === '1/2 Hr' && index % 1500 === 0) || (click === '1 Hr' && index % 3000 === 0) || index === data.length - 1 || index === 0) && (
                <div className="timestamp">{entry.timestamp}</div>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TimelineGraph;
